/**
 * 功能: 端外调用app(唤起后再执行app接口)
 * 用法:
 * call({
      v: '3.1.0',
      host: 'Browser',
      action: 'open',
      param: {
        invoke: true,
        ...
      },
    });
 */
function outerCall() {
  var param = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : {};
  var stayCurrentPage = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : false;

  // 在app中,直接返回
  if (_dvdBaseJsUa2.default.isDvdApp()) return;

  // 端内调用协议
  var protocal = getProtocal(param);

  if (_dvdBaseJsUa2.default.isAndroid()) {
    // 端外唤起协议
    var outerProtocal = 'davdian://invoke.davdian.com?cmd=' + encodeURIComponent(protocal);

    // 打印协议
    console.log(outerProtocal);

    // 唤起app
    location.href = outerProtocal;

    if (!stayCurrentPage) {
      // 兜底跳转下载页
      setTimeout(function () {
        location.href = '//a.app.qq.com/o/simple.jsp?pkgname=com.davdian.seller';
      }, 3000);
    }
  } else if (_dvdBaseJsUa2.default.isIos()) {
    // let env = /(davdian\.com|vyohui\.cn|bravetime\.net)/.exec(location.href)[0];

    // 端外唤起协议
    var _outerProtocal = '//invoke.davdian.com?cmd=' + encodeURIComponent(protocal);

    // 打印协议
    console.log(_outerProtocal);

    // alert(protocal)
    // alert(outerProtocal);

    // 唤起app
    location.href = _outerProtocal;
  }
}

/**
 * 功能: 调用native(核心方法)
 * 用法:
 * call({
      v: '3.1.0',
      host: 'Browser',
      action: 'open',
      param: {
        invoke: true,
        ...
      },
    });
 * stayCurrentPage 为true 代表从外部跳转时不跳转应用宝 留在当前页
 */
function call() {
  var param = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : {};
  var stayCurrentPage = arguments[1];

  // 如果param.param.invoke为真,需要先唤起native再执行cmd
  var a = '';
  for (var p in param.param.content) {
    a += p + '=' + param.param.content[p];
  }
  // alert(a);
  if (param.param.invoke) {
    delete param.param.invoke;
    outerCall(param, stayCurrentPage);
  } else {
    innerCall(param);
  }
}

